import React from "react";

const Home = () => {
    return (
        <main>
            <section class="container products p-5">
                <h2 class="text-center display-2 fw-bold py-2">
                    Our Offerings
                </h2>
                <div class="row g-4 text-center ">{<ProductCard />}</div>
            </section>
        </main>
    );
};

export default Home;
